description:
Verenigde Staten / Canada
Horror / Thriller
103 minuten

een goeie film

met Patrick Wilson, Rose Byrne en Ty Simpkins

Josh (Patrick Wilson) en Renai (Rose Byrne) zijn een gelukkig koppel met kinderen dat verhuist naar een nieuwe woning. Maar het 
blijkt dat het huis problemen heeft met de nieuwe familie: vreemde en angstaanjagende dingen gebeuren en schijnen voornamelijk 
betrekking te hebben op hun jonge zoon Dalton (Ty Simpkins).
